  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:47.968452\",\n\t\"name\": \"fishery-management-plan-for-hillside-national-wildlife-refuge-1989\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Hillside National Wildlife Refuge occupies
  15,383 acres of west central Mississippi in the Mississippi/Yazoo River alluvial
  plain. The refuge is situated between loess bluff hills and the U.S. Army Corps
  of Engineers Hillside Floodway levee in Holmes and Yazoo Counties. The alluvial
  soils of the area are high in natural fertility and have clay to silt loam textures.
  Over 10,000 acres are seasonally flooded and hence not managed for fish. There are
  78 borrow ponds, approximately one acre each, the upper 46 of which have been managed
  in the past. However, flood waters have inundated these ponds several times in past
  years, and undesirable fish species have reinhabited and now dominate. The rich
  ponds average over 400 pounds of fish each, and it is believed that a low (4 to
  5') levee to preclude floodwater would allow development of a highly productive
  sport fishery that would yield over 15,000 pounds of bass, bream, and catfish to
  anglers annually.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
